"use strict";(self.webpackChunkdoc=self.webpackChunkdoc||[]).push([[1148],{97089:e=>{e.exports=JSON.parse('{"pluginId":"mampf-pages","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"docs":[{"type":"link","label":"Seiten der MaMpf","href":"/mampf/mampf-pages/","docId":"mampf"},{"type":"link","label":"Seiten f\xfcr alle Nutzer*innen","href":"/mampf/mampf-pages/all-pages","docId":"all-pages"},{"type":"link","label":"Seiten f\xfcr Vortragende","href":"/mampf/mampf-pages/all-pages-talk","docId":"all-pages-talk"},{"type":"link","label":"Seiten f\xfcr Editor*innen","href":"/mampf/mampf-pages/all-pages-ed","docId":"all-pages-ed"},{"type":"link","label":"Seiten f\xfcr Adminstrator*innen","href":"/mampf/mampf-pages/all-pages-ad","docId":"all-pages-ad"}]},"docs":{"access":{"id":"access","title":"Erreichbarkeit","description":"This page will be written soon."},"activate-account":{"id":"activate-account","title":"Anleitung zur Best\xe4tigung des Account erneut versenden","description":"Die Seite \u201eAnleitung zur Best\xe4tigung des Accounts erneut versenden\u201c wird ben\xf6tigt, wenn man sich registriert, aber keine Best\xe4tigungsmail erhalten hat. Bevor man diese Seite konsultiert, sollte man \xfcberpr\xfcfen, ob die Best\xe4tigungsmail nicht im Spamordner gelandet ist. Falls man hingegen die E-Mail zum Zur\xfccksetzen des Passworts nicht bekommen hat, sollte man sie erneut auf der Seite \u201ePasswort vergessen\u201c anfordern. Um die E-Mail zur Aktivierung des Accounts zu erhalten, gibt man auf der Seite \u201eAnleitung zur Best\xe4tigung des Accounts erneut versenden\u201c die E-Mail-Adresse ein, mit der man sich vorher registriert hat. Diese E-Mail enth\xe4lt einen Aktivierungslink, mit dem der Account freigeschaltet werden kann."},"active":{"id":"active","title":"Aktiv","description":"This page will be written soon."},"ad-export-stats":{"id":"ad-export-stats","title":"Statistiken exportieren","description":"This page will be written soon."},"ad-manage-forums":{"id":"ad-manage-forums","title":"Forenverwaltung","description":"This page will be written soon."},"ad-manage-users":{"id":"ad-manage-users","title":"Nutzerverwaltung","description":"This page will be written soon."},"ad-news":{"id":"ad-news","title":"News","description":"This page will be written soon."},"ad-semester-overview":{"id":"ad-semester-overview","title":"Semester\xfcbersicht","description":"This page will be written soon."},"ad-stats":{"id":"ad-stats","title":"Zugriffsstatistiken","description":"This page will be written soon."},"ad-systematics":{"id":"ad-systematics","title":"Systematik","description":"This page will be written soon."},"administrative":{"id":"administrative","title":"Administrativ","description":"This page will be written soon."},"all-pages":{"id":"all-pages","title":"Seiten f\xfcr alle Nutzer*innen","description":"Im Folgenden werden alle Seiten der MaMpf, die allen Nutzer\\\\*innen zug\xe4nglich sind, alphabetisch aufgelistet.","sidebar":"docs"},"all-pages-ad":{"id":"all-pages-ad","title":"Seiten f\xfcr Adminstrator*innen","description":"Im Folgenden werden alle Seiten der MaMpf, die Administrator\\\\innen zug\xe4nglich sind, alphabetisch aufgelistet. Adminstrator\\\\innen haben zudem Zugriff auf Seiten f\xfcr alle Nutzer\\\\innen und Editor\\\\innen.","sidebar":"docs"},"all-pages-ed":{"id":"all-pages-ed","title":"Seiten f\xfcr Editor*innen","description":"Im Folgenden werden alle Seiten der MaMpf, die Editor\\\\innen zug\xe4nglich sind, alphabetisch aufgelistet. Editor\\\\innen haben zudem Zugriff auf Seiten f\xfcr alle Nutzer\\\\*innen.","sidebar":"docs"},"all-pages-talk":{"id":"all-pages-talk","title":"Seiten f\xfcr Vortragende","description":"In einem Proseminar, Seminar oder Oberseminar k\xf6nnen einfache Nutzer\\\\*innen zu Vortragenden bef\xf6rdert werden. Dadurch erhalten sie Bearbeitungsrechte f\xfcr ihren Vortrag, die sie auf den folgenden Seiten aus\xfcben k\xf6nnen.","sidebar":"docs"},"all-pages-tut":{"id":"all-pages-tut","title":"Seiten f\xfcr Tutor*innen","description":"Im Folgenden werden alle Seiten der MaMpf, die Tutor\\\\innen zug\xe4nglich sind, alphabetisch aufgelistet. Tutor\\\\innen haben zudem Zugriff auf Seiten f\xfcr alle Nutzer\\\\*innen."},"announcements":{"id":"announcements","title":"Mitteilungen","description":"Die Seite \u201eMitteilungen\u201c ist eine Unterseite einer Veranstaltung. Auf ihr k\xf6nnen Nutzer\\\\*innen Mitteilungen zur Veranstaltungen (z.B. Informationen zu Fehlern auf \xdcbungsbl\xe4ttern oder zur Klausur) lesen."},"change-login-data":{"id":"change-login-data","title":"Zugangsdaten \xe4ndern","description":"Auf der Seite \u201eZugangsdaten \xe4ndern\u201c kann man die E-Mail-Adresse und das Passwort zum Account \xe4ndern."},"change-password":{"id":"change-password","title":"Passwort \xe4ndern","description":"Auf der Seite \u201ePasswort \xe4ndern\u201c kann man das Passwort \xe4ndern, wenn man es vergessen hat. Falls man das Passwort hingegen kennt und \xe4ndern m\xf6chte, ist dies auf der Seite \u201eProfil\u201c m\xf6glich. Um die Seite \u201ePasswort \xe4ndern\u201c zu \xf6ffnen, muss man die \xc4nderung des Passworts auf der Seite \u201ePasswort vergessen\u201c anfordern und auf den Link \u201ePasswort \xe4ndern\u201c in der im Anschluss daran erhaltenen E-Mail klicken."},"clicker":{"id":"clicker","title":"Clicker","description":"Ein Clicker ist ein Feedbackkanal, der auf MaMpf als Seite realisiert ist. Personen mit dem Editorlink k\xf6nnen Feedback zu einer Fragestellung erbitten und Personen mit dem Teilnehmerlink k\xf6nnen dieses Feedback geben. Pro Clicker ist zu jedem Zeitpunkt genau eine Fragestellung m\xf6glich. Dabei k\xf6nnen auch Fragen aus der MaMpf-Datenbank verwendet werden. Die Fragen bzw. Antwortm\xf6glichkeiten k\xf6nnen beliebig oft ver\xe4ndert werden, weshalb Clicker wiederverwendet werden k\xf6nnen."},"comments":{"id":"comments","title":"Kommentare","description":"Die Kommentarseite gibt einen \xdcberblick \xfcber Diskussionen in abonnierten Veranstaltungen. Von dort k\xf6nnen Diskussionen angesteuert und zur Kenntnis genommen sowie Diskussionsabos zentral verwaltet werden. Auf der Kommentarseite eines Mediums hingegen k\xf6nnen Beitr\xe4ge zu einem Medium gelesen und verfasst werden. Die Kommentarseite eines Mediums kann von der Kommentarseite aus ge\xf6ffnet werden. \xdcber abonnierte Diskussionen wird man per E-Mail auf dem Laufenden gehalten. Wenn ein neuer Diskussionbeitrag in einer abonnierten Veranstaltung ver\xf6ffentlicht worden ist, so f\xe4rbt sich das Icon  in der Navigationsleiste blau."},"comments-medium":{"id":"comments-medium","title":"Kommentare f\xfcr ein Medium","description":"Auf der Seite \u201eKommentare f\xfcr ein Medium\u201c k\xf6nnen Diskussionsbeitr\xe4ge gelesen und verfasst werden. Editor\\\\*innen k\xf6nnen zudem Diskussionen moderieren und \xf6ffnen oder schlie\xdfen. Zu jedem Medium gibt es eine solche Kommentarseite. Auf der Seite \u201eKommentare\u201c hingegen kann man sich einen \xdcberblick \xfcber alle Aktivit\xe4ten auf den Seiten \u201eKommentare f\xfcr ein Medium\u201c verschaffen. Dabei werden nur Medien ber\xfccksichtigt, die zu einer abonnierten Veranstaltung assoziiert sind."},"communicative":{"id":"communicative","title":"Kommunikativ","description":"This page will be written soon."},"concept":{"id":"concept","title":"Konzeption","description":"This page will be written soon."},"connecting-concepts":{"id":"connecting-concepts","title":"Vernetzung","description":"This page will be written soon."},"course-card":{"id":"course-card","title":"Veranstaltungscard","description":"Auf Veranstaltungscards werden kurz und b\xfcndig die wichtigsten Informationen zu einer Veranstaltung pr\xe4sentiert. Auf ihnen k\xf6nnen Veranstaltungsabo begonnen und beendet werden. Au\xdferdem k\xf6nnen Veranstaltungen ge\xf6ffnet werden. Das Aussehen von Veranstaltungscards ebenso wie die auf ihnen verf\xfcgbaren Bedienelemente h\xe4ngt davon ab, ob eine Veranstaltung abonniert ist."},"create-a-blog-post":{"id":"create-a-blog-post","title":"Create a Blog Post","description":"This page will help you on how to create blog posts in Docusaurus."},"create-a-document":{"id":"create-a-document","title":"Create a Document","description":"Documents are pages with a sidebar, a previous/next navigation and many other useful features."},"create-a-page":{"id":"create-a-page","title":"Create a Page","description":"Any React or Markdown file created under src/pages directory is converted into a website page:"},"design-and-structure":{"id":"design-and-structure","title":"Gestaltungselemente","description":"This page will be written soon."},"ed-create-tag":{"id":"ed-create-tag","title":"Tag anlegen","description":"Auf der Seite \u201eTag anlegen\u201c k\xf6nnen Editor\\\\*innen einen neuen Tag anlegen."},"ed-edit-chapter":{"id":"ed-edit-chapter","title":"Kapitel bearbeiten","description":"Auf der Seite \u201eKapitel bearbeiten\u201c k\xf6nnen Editor\\\\*innen \xc4nderungen an einem Kapitel einer Vorlesung vornehmen. Sie k\xf6nnen die Position des Kapitels in der Vorlesungsgliederung ver\xe4ndern, die Kapitelnummer festlegen, Abschnitte innerhalb des Kapitels anlegen und den Beschreibungstext des Kapitels bearbeiten."},"ed-edit-event-series":{"id":"ed-edit-event-series","title":"Veranstaltung bearbeiten","description":"Auf der Seite \u201eVeranstaltung bearbeiten\u201c k\xf6nnen Einstellungen der Veranstaltung bearbeitet und Inhalte hinzugef\xfcgt werden. Es gibt zwei Realisierung der Seite \u201eVeranstaltung bearbeiten\u201c: die Seiten \u201eVorlesung bearbeiten\u201c und \u201eSeminar bearbeiten\u201c. Diese Seiten sind nur f\xfcr Editor\\\\innen der Veranstaltung, Editor\\\\innen des \xfcbergeordenten Moduls und Adminstrator\\\\*innen zug\xe4nglich."},"ed-edit-lecture":{"id":"ed-edit-lecture","title":"Vorlesung bearbeiten","description":"This page will be written soon."},"ed-edit-manuscript":{"id":"ed-edit-manuscript","title":"Skript bearbeiten","description":"Auf der Seite \u201eSkript bearbeiten\u201c k\xf6nnen Editor\\\\innen \xc4nderungen an einem Medium vom Typ Skript vornehmen. Dazu geh\xf6ren die Ver\xf6ffentlichung des Skriptes, das Bearbeiten von Medientitel, Zugriffsrechten und Sprache, die Verkn\xfcpfug des Skripts mit anderen Medien, das Verfassen oder Bearbeiten der Inhaltsangabe, das Hochladen oder Ersetzen des PDFs sowie das Betrachten der Aufruf- und Downloadstatistik. Falls in den Veranstaltungseinstellungen die Inhaltsvermittlung \u201eunter Verwendung eines Veranstaltungsskriptes, das mit dem MaMpf LaTeX-Paket erstellt wurde\u201c  ausgew\xe4hlt ist, k\xf6nnen Editor\\\\innen zudem die Gliederung und Tags aus dem Skript importieren, sofern das Skript mit dem MaMpf-LaTeX-Paket erstellt wurde."},"ed-edit-medium":{"id":"ed-edit-medium","title":"Edit Medium","description":"This page will be written soon."},"ed-edit-module":{"id":"ed-edit-module","title":"Modul bearbeiten","description":"This page will be written soon."},"ed-edit-section":{"id":"ed-edit-section","title":"Abschnitt bearbeiten","description":"Auf der Seite \u201eAbschnitt bearbeiten\u201c k\xf6nnen Editor\\\\*innen \xc4nderungen am Abschnitt einer Vorlesung vornehmen. Sie k\xf6nnen Sitzungen erstellen, Tags anlegen, hinzuf\xfcgen und entfernen, den Abschnitt von der Gliederung ausnehmen sowie den Titel, die Position und den Beschreibungstext des Abschnitts bearbeiten."},"ed-edit-seminar":{"id":"ed-edit-seminar","title":"Seminar bearbeiten","description":"This page will be written soon."},"ed-edit-session":{"id":"ed-edit-session","title":"Sitzung bearbeiten","description":"Auf der Seite \u201eSitzung bearbeiten\u201c k\xf6nnen Editor\\\\*innen \xc4nderungen an einer Sitzung einer Vorlesung vornehmen. Sie k\xf6nnen Medien erstellen, Tags anlegen, hinzuf\xfcgen und entfernen, Abschnitte assoziieren, sowie das Datum und den Beschreibungstext der Sitzung bearbeiten. Das Pendant zu dieser Seite bei Veranstaltungen des Typs Seminar ist die Seite \u201eVortrag bearbeiten\u201c."},"ed-edit-tag":{"id":"ed-edit-tag","title":"Begriff bearbeiten","description":"Auf der Seite \u201eBegriff bearbeiten\u201c k\xf6nnen Editor\\\\innen assoziierte Begriffe, Veranstaltungen, Medien, Abschnitte und Sitzungen einsehen. Personen mit entsprechenden Rechten k\xf6nnen dar\xfcber hinaus Bezeichnungen, Assozierungen zu Modulen und anderen Tags sowie Realisierungen bearbeiten. Die Bezeichnungen Begriff und Tag* werden auf MaMpf und in dieser Dokumentation synonym verwendet."},"ed-edit-talk":{"id":"ed-edit-talk","title":"Edit Talk","description":"This page will be written soon."},"ed-inspect-medium":{"id":"ed-inspect-medium","title":"Medium inspizieren","description":"Auf der Seite \u201eMedium\u201c erhalten Editor*innen Informationen \xfcber Medien, f\xfcr die sie keine Bearbeitungsrechte haben."},"ed-overview":{"id":"ed-overview","title":"\xdcbersicht","description":"Die \xdcbersichtsseite ist die Startseite der Administration. Dort k\xf6nnen Editor\\\\innen sich einen \xdcberblick verschaffen \xfcber die Veranstaltungen und Module, f\xfcr die sie Editorenrechte haben, die letzten 25 Medien, die sie bearbeitet haben, und ihre Clicker. Zudem k\xf6nnen sie diese \xf6ffnen. Alle Personen mit Editorenrechten k\xf6nnen auf dieser Seite au\xdferdem Clicker anlegen. Nutzer\\\\innen mit entsprechenden Rechten k\xf6nnen dar\xfcber hinaus auch Veranstaltungen und Module anlegen."},"ed-profile":{"id":"ed-profile","title":"Mein Profil","description":"This page will be written soon."},"ed-search-extended":{"id":"ed-search-extended","title":"Erweiterte Suche","description":"Auf der Seite \u201eErweiterte Suche\u201c k\xf6nnen Editor\\\\*innen nach Medien, Veranstaltungen, Modulen und Tags suchen. Dazu stehen diverse Filter zur Verf\xfcgung."},"edit-medium":{"id":"edit-medium","title":"Medium bearbeiten","description":"Auf der Seite \u201eMedium bearbeiten\u201c k\xf6nnen Vortragende und Editor\\\\innen \xc4nderungen an einem Medium vom Typ Lektion, Worked Example, \xdcbung, Wiederholung, Sonstiges oder Beispieldatenbank* vornehmen. Zur Bearbeitung der \xfcbrigen Medientypen siehe Quiz bearbeiten, Frage bearbeiten, Erl\xe4uterung bearbeiten und Skript bearbeiten. Dabei ist zu beachten, dass Vortragende Skripte weder anlegen noch bearbeiten k\xf6nnen."},"edit-medium-question":{"id":"edit-medium-question","title":"Frage bearbeiten (Medium)","description":"This page will be written soon."},"edit-medium-remark":{"id":"edit-medium-remark","title":"Erl\xe4uterung bearbeiten (Medium)","description":"This page will be written soon."},"edit-question":{"id":"edit-question","title":"Quizfrage bearbeiten","description":"Auf der Seite \u201eFrage bearbeiten\u201c kann man eine bereits angelegte Frage bearbeiten, d.h. den Fragetext, den L\xf6sungshinweis und die Antwortm\xf6glichkeiten \xe4ndern sowie den Typ und den Schwierigkeitsgrad der Frage einstellen. Au\xdferdem kann man der Frage das Attribut \u201eunabh\xe4ngig\u201c zuweisen, wodurch sie bei Selbsttests ber\xfccksichtigt wird."},"edit-quiz":{"id":"edit-quiz","title":"Quiz bearbeiten","description":"Auf der Seite \u201eQuiz bearbeiten\u201c k\xf6nnen Vortragende und Editor\\\\*innen \xc4nderungen an einem Quiz vornehmen. Zur Bearbeitung anderer Medientypen siehe Medium bearbeiten, Frage bearbeiten, Erl\xe4uterung bearbeiten und Skript bearbeiten."},"edit-remark":{"id":"edit-remark","title":"Quizerl\xe4uterung bearbeiten","description":"Auf der Seite \u201eErl\xe4uterung bearbeiten\u201c kann man eine bereits angelegte Erl\xe4uterung bearbeiten, also den Erl\xe4uterungstext."},"edit-talk":{"id":"edit-talk","title":"Vortrag bearbeiten","description":"Auf der Seite \u201eVortrag bearbeiten\u201c k\xf6nnen Vortragende und Editor\\\\innen \xc4nderungen am Vortrag vornehmen. Vortragende k\xf6nnen Begriffe aus der MaMpf-Datenbank und eigene Medien hinzuf\xfcgen sowie den Beschreibungstext bearbeiten. Editor\\\\innen k\xf6nnen zudem neue Begriffe anlegen sowie die Vortragenden, das Vortragsdatum und die Position des Vortrags in der Gliederung bearbeiten. Au\xdferdem k\xf6nnen sie einen Beschreibungstext verfassen bzw. bearbeiten und den Text der Vortragenden von der Vortragsseite entfernen. Die Unterschiede zwischen der Seite f\xfcr Editor\\\\*innen und der f\xfcr Vortragende sind gering, daher werden die Seiten in diesem Artikel gemeinsam beschrieben, wobei jeweils auf die nutzertypspezifischen Besonderheiten eingegangen wird. Das Pendant zu dieser Seite bei Veranstaltungen des Typs Vorlesung ist die Seite \u201eSitzung bearbeiten\u201c."},"erdbeere":{"id":"erdbeere","title":"Beispieldatenbank","description":"Die Seite \u201eBeispiel-Datenbank\u201c ist eine Unterseite einer Veranstaltung, zu der wiederum weitere Unterseiten geh\xf6ren. Sie erm\xf6glicht Nutzer\\\\innen die Suche nach konkreten Beispielen. Dazu geben Nutzer\\\\innen an, welche Eigenschaften erf\xfcllt und verletzt sein sollen. Als Suchergebnis werden Beispiele oder ein Beweis, dass ein solches Objekt nicht existieren kann, ausgegeben."},"event-series":{"id":"event-series","title":"Veranstaltung","description":"Die Veranstaltungsseite enth\xe4lt aktuelle Informationen und die Gliederung der Veranstaltung. Von ihr aus gelangt man zu Veranstaltungsinhalten (Videos, PDF-Dateien, Mindmaps, Quizzes und Beispielen), Informationen zur Veranstaltung, Diskussionsforen sowie der Zettelabgabe und im Fall von Seminaren zu Vortr\xe4gen und Bearbeitungsseiten f\xfcr den eigenen Vortrag. Auf MaMpf gibt es die Veranstaltungstypen Vorlesungen und Seminar (wobei Proseminar, Seminar und Oberseminar darunter subsumiert werden), siehe auch siehe Seminar und Vorlesung."},"event-series-card":{"id":"event-series-card","title":"Event Series Card","description":"This page will be written soon."},"event-series-list":{"id":"event-series-list","title":"Veranstaltung","description":"This page will be written soon."},"exercises":{"id":"exercises","title":"\xdcbungen","description":"Die Seite \u201e\xdcbungen\u201c ist eine Unterseite einer Veranstaltung. Sie erm\xf6glicht Nutzer\\\\*innen Zugriff auf die \xdcbungen zur Veranstaltung. In einer \xdcbung werden inhaltlich zusammengeh\xf6rende Dateien (PDF, Video und externer Link) geb\xfcndelt. Diese k\xf6nnen betrachtet, heruntergeladen und kommentiert werden."},"footer":{"id":"footer","title":"Footer","description":"This page will be written soon."},"function":{"id":"function","title":"Funktion","description":"This page will be written soon."},"general-information":{"id":"general-information","title":"Organisatorisches","description":"Die Seite \u201eOrganisatorisches\u201c ist eine Unterseite einer Veranstaltung. Sie soll alle organisatorischen Fragen zur Veranstaltung der Studierenden beantworten. Auf ihr sollen Editor\\\\*innen alle f\xfcr die Veranstaltungsorganisation relevanten Informationen zusammentragen, wie z.B. zu Terminen, dem \xdcbungsbetrieb, Begleitliteratur sowie Pr\xfcfungs- und Benotungsregeln."},"home-page":{"id":"home-page","title":"Startseite","description":"Die Startseite ist die erste Seite auf die man kommt, wenn man die MaMpf-Homepage \xf6ffnet. Auf ihr wird das MaMpf-Projekt vorgestellt. Von ihr aus gelangt man zu Seiten, auf den man sich registrieren, einloggen oder das Passwort zur\xfccksetzen kann. Sobald man sich eingeloggt hat, ist eine andere Startseite \u2013 die pers\xf6nliche Startseite \u2013 zug\xe4nglich, auf der man Veranstaltungen \xf6ffnen und abonnieren kann."},"informative":{"id":"informative","title":"Informativ","description":"This page will be written soon."},"lecture":{"id":"lecture","title":"Vorlesung","description":"Die Vorlesungsseite enth\xe4lt aktuelle Informationen und die Gliederung der Veranstaltung. Von ihr aus gelangt man zu Veranstaltungsinhalten (Videos, PDF-Dateien, Mindmaps, Quizzes und Beispielen), Informationen zur Veranstaltung, Diskussionsforen und der Zettelabgabe."},"lecturer":{"id":"lecturer","title":"Dozent*in","description":"Auf der Seite \u201eDozentIn\u201c k\xf6nnen weitere Informationen zur Dozent\\\\*in gefunden werden und zwar die E-Mail-Adresse, die Homepage und eine \xdcbersicht der auf MaMpf betreuten Veranstaltungen."},"lessons":{"id":"lessons","title":"Lektionen","description":"Die Seite \u201eLektionen\u201c ist eine Unterseite einer Veranstaltung. Sie erm\xf6glicht Nutzer\\\\*innen Zugriff auf Lektionen der Veranstaltung. In einer Lektion werden inhaltlich zusammengeh\xf6rende Dateien (PDF, Video und externer Link) geb\xfcndelt. Diese k\xf6nnen betrachtet bzw. abgespielt und heruntergeladen sowie kommentiert werden."},"login":{"id":"login","title":"Login","description":"Auf der Loginseite kann man sich einloggen, wenn man bereits einen MaMpf-Account besitzt. Falls man sich noch nicht auf MaMpf registriert hat, gelangt man von dort aus zur Seite \u201eRegistrieren\u201c, auf der man einen Account anlegen kann. Wenn man das Passwort vergessen oder die E-Mail zum Zur\xfccksetzen nicht erhalten hat, kann man die daf\xfcr vorgesehenen Seiten \u201ePasswort vergessen\u201c und \u201eAnleitung zur Best\xe4tigung des Accounts erneut versenden\u201c \xf6ffnen."},"logout":{"id":"logout","title":"Logout","description":"Auf die Logoutseite gelangt man, nachdem man eingeloggt gewesen ist und sich ausgeloggt hat, indem man auf  in der Navigationsleiste geklickt hat. Abgesehen von dem zus\xe4tzlichen Text \u201eDu hast Dich erfolgreich abgemeldet.\u201c unterscheidet sich diese Seite nicht von der Startseite."},"mampf":{"id":"mampf","title":"Seiten der MaMpf","description":"\\\\ Diese Seite ist in Bearbeitung. \\\\","sidebar":"docs"},"mampf-maps":{"id":"mampf-maps","title":"MaMpf-Maps","description":"This page will be written soon."},"manuscript":{"id":"manuscript","title":"Skript","description":"Die Seite \u201eSkript\u201c ist eine Unterseite einer Veranstaltung. Sie erm\xf6glicht Nutzer\\\\*innen Zugriff auf das Skript der Veranstaltung. Dieses kann betrachtet, heruntergeladen und kommentiert werden."},"markdown-features":{"id":"markdown-features","title":"Markdown Features","description":"Docusaurus supports the Markdown syntax and has some additional features."},"media-of-the-same-type":{"id":"media-of-the-same-type","title":"Medien eines Typs","description":"Die Seiten \u201eMedien eines Typs\u201c sind Unterseiten von Veranstaltungen. Dabei handelt es sich um die folgenden Seiten:"},"mediacard":{"id":"mediacard","title":"Mediacard","description":"\\\\Diese Seite ist in Bearbeitung.\\\\"},"medium":{"id":"medium","title":"Medium","description":"Die Seite \u201eMedium\u201c ist eine Unterseite einer Veranstaltung oder eines Moduls. MaMpf kennt die Medien Lektion, Worked Example, \xdcbung, Skript, Wiederholung, Quiz, Quiz-Frage, Quiz-Erl\xe4uterung, Beispiel-Datenbank und Sonstiges. Die jeweiligen Medienseiten enthalten weitere Informationen zum Medium (z.B. verkn\xfcpfte Begriffe und Medien sowie Kommentare) und unterscheiden sich abh\xe4ngig vom Typ in wenigen Details."},"miscellaneous":{"id":"miscellaneous","title":"Sonstiges","description":"Die Seite \u201eSonstiges\u201c ist eine Unterseite einer Veranstaltung. Sie erm\xf6glicht Nutzer\\\\*innen Zugriff auf Medien, die in keine der in MaMpf definierten Medien-Kategorien passen. Diese k\xf6nnen betrachtet, heruntergeladen und kommentiert werden."},"module":{"id":"module","title":"Modul","description":"Die Seite \u201eModul\u201c ist eine Unterseite einer Veranstaltung. Auf ihr k\xf6nnen Nutzer\\\\innen Informationen zum Modul lesen. Die Beschreibung sollte Auskunft \xfcber Moduleditor\\\\innen, Anzahl der Leistungspunkte, Turnus, Inhalt, Lernziele und Voraussetzungen geben."},"my-home-page":{"id":"my-home-page","title":"Meine Startseite","description":"Die pers\xf6nliche Startseite ist die Seite, auf die man gelangt, nachdem man sich eingeloggt hat. Auf der pers\xf6nlichen Startseite kann man Veranstaltungsabo verwalten, sich \xfcber abonnierte Veranstaltungen informieren und diese \xf6ffen, zu eigenen Vortr\xe4gen navigieren sowie nach Veranstaltungen suchen."},"nav-bar":{"id":"nav-bar","title":"Navigationsleiste","description":"Die Navigationsleiste befindet sich oben auf der Seite. Mit ihr kann man sich durch MaMpf bewegen. Bei Editor\\\\*nnen gibt es einen zus\xe4tzlichen Button, mit dem in den Adminstrationsmodus gewechselt werden kann. In diesem stehen dann andere Buttons zur Verf\xfcgung."},"nav-bar-pages":{"id":"nav-bar-pages","title":"Navigationsleiste","description":"Die Navigationsleiste befindet sich oben auf der Seite. Mit ihr kann man sich durch MaMpf bewegen. \xdcber die Navigationsleiste sind folgende Seiten erreichbar:"},"navigation":{"id":"navigation","title":"Navigation","description":"This page will be written soon."},"news":{"id":"news","title":"News","description":"Auf der Seite \u201eNews\u201c kann man sich \xfcber Neuigkeiten, die MaMpf betreffen, informieren."},"notifications":{"id":"notifications","title":"Benachrichtigungen","description":"Auf der Seite \u201eBenachrichtungen\u201c k\xf6nnen Neuigkeiten zu abonnierten Veranstaltungen (Mitteilungen und Ver\xf6ffentlichung neuer Medien), dem Kursangebot und zu MaMpf selbst gelesen werden."},"pages-of-a-course":{"id":"pages-of-a-course","title":"Unterseiten einer Veranstaltung","description":"Die folgenden Seiten sind Unterseiten einer Veranstaltung."},"password-forgotten":{"id":"password-forgotten","title":"Passwort vergessen","description":"Auf der Seite \u201ePasswort vergessen\u201c kann man einen Link zum Zur\xfccksetzen des Passworts anfordern. Dieser wird per E-Mail an die angegebene Adresse geschickt und erm\xf6glicht das \xc4ndern des Passworts. Die \xc4nderung eines bekannten Passworts sollte auf der Seite \u201eProfil\u201c erfolgen."},"profile":{"id":"profile","title":"Profileinstellungen","description":"\\\\Diese Seite ist in Bearbeitung.\\\\"},"quiz-editor":{"id":"quiz-editor","title":"Quizeditor","description":"Mit dem Quizeditor kann man den Quizgraphen bearbeiten, indem man Ecken und Kanten anlegt oder ver\xe4ndert. Ferner kann man den Schwierigkeitsgrad des Quiz\' festlegen und das Quiz linearisieren."},"quizzes":{"id":"quizzes","title":"Quizzes","description":"Die Seite \u201eQuizzes\u201c ist eine Unterseite einer Veranstaltung. Auf ihr k\xf6nnen Nutzer\\\\*innen ihr Wissen mit Quizzes \xfcberpr\xfcfen. Quizzes bestehen aus einem festen Fragenbestand, bei komplexen Quizzes (angeleitetete Beweise) wird die Auswahl und Reihenfolge der Fragen von den gegebenen Antworten bestimmt. Bei den Selbsttests hingegen werden zuf\xe4llig Fragen aus der Datenbank ausgew\xe4hlt."},"registration":{"id":"registration","title":"Registrieren","description":"Auf der Seite \u201eRegistrieren\u201c kann man einen MaMpf-Account anlegen. Dazu ben\xf6tigt man lediglich eine E-Mail-Adresse. F\xfcr das Erstellen des Accounts ist ein Passwort und die Zustimmung zur Speicherung und Verarbeitung der Daten erforderlich."},"repetition":{"id":"repetition","title":"Wiederholung","description":"Die Seite \u201eWiederholung\u201c ist eine Unterseite einer Veranstaltung. Sie erm\xf6glicht Nutzer\\\\*innen Zugriff auf Wiederholungen, also auf Inhalte, die einen \xdcberblick \xfcber vorausgesetzte Kenntnisse vermitteln und Wissen auffrischen. In einer Wiederholung werden inhaltlich zusammengeh\xf6rende Dateien (PDF, Video und externer Link) geb\xfcndelt. Diese k\xf6nnen betrachtet bzw. abgespielt und heruntergeladen sowie kommentiert werden."},"search-results":{"id":"search-results","title":"Suchergebnisse","description":"Auf der Seite \u201eSuchergebnisse\u201c werden Treffer einer Suche angezeigt. Bei dieser Suche handelt es sich um die Tagsuche. Diese wird \xfcber das Suchfeld in der Navigationsleiste ausgef\xfchrt und ist bei allen Nutzer\\\\innen verf\xfcgar. Editor\\\\innen haben dar\xfcber hinaus Zugriff auf die erweiterte Suche im Adminstrationsbereich. Bei der erweiterten Suche kann die MaMpf-Datenbank nach Medien, Veranstaltungen, Modulen und Tags mit optionalen Einschr\xe4nkungen durchsucht werden."},"section":{"id":"section","title":"Abschnitt","description":"Die Seite \u201eAbschnitt\u201c ist eine Unterseite einer Veranstaltung. Auf ihr kann man sich einen \xdcberblick \xfcber den Inhalt des Abschnitts sowie \xfcber verkn\xfcpfte Begriffe, Medien und Sitzungen verschaffen. \xdcber die Inhalts\xfcbersicht k\xf6nnen PDF-Dateien und Videos an der gew\xfcnschten Stelle ge\xf6ffnet werden."},"self-assessment":{"id":"self-assessment","title":"Selbsttest","description":"Die Seite \u201eSelbsttest\u201c ist eine Unterseite einer Veranstaltung. Auf ihr k\xf6nnen Nutzer\\\\innen ihr Wissen mit einem Selbsttest \xfcberpr\xfcfen. Bei Selbsttests werden zuf\xe4llig Fragen aus der Datenbank ausgew\xe4hlt. Nutzer\\\\innen k\xf6nnen dabei bestimmen, wie viele Fragen der Test haben soll und welche Inhalte abgefragt werden. Quizzes hingegen haben einen fixen Fragenbestand."},"seminar":{"id":"seminar","title":"Seminar","description":"Die Seminarseite enth\xe4lt aktuelle Informationen und die Gliederung der Veranstaltung. Von ihr aus gelangt man zu Veranstaltungsinhalten (Videos, PDF-Dateien, Mindmaps, Quizzes und Beispielen), Vortr\xe4gen, Bearbeitungsseiten f\xfcr den eigenen Vortrag, Informationen zur Veranstaltung, Diskussionsforen und der Zettelabgabe."},"session":{"id":"session","title":"Sitzung","description":"Die Seite \u201eSitzung\u201c ist eine Unterseite einer Veranstaltung. Dort finden Nutzer\\\\*innen eine Gliederung oder Inhaltsbeschreibung der Sitzung sowie verkn\xfcpfte Abschnitte, Begriffe und Medien. Weiterhin kann von dieser Seite aus zur assoziierten Lektion gewechselt werden."},"sidebar":{"id":"sidebar","title":"Seitenleiste","description":"Die Seitenleiste erm\xf6glicht die Navigation innerhalb einer Veranstaltung. Sie befindet sich auf der linken Seite, sofern eine Veranstaltung ge\xf6ffnet ist. In dieser Leiste k\xf6nnen sowohl Textelemente in blauer als auch in grauer Schrift vorkommen. Im Gegensatz zu grauen Textelementen fungieren blaue als Buttons, \xfcber die man auf andere Seiten gelangt. Die grauen Textelemente f\xe4rben sich blau und werden zu Buttons, sobald Inhalte der entsprechenden Kategorie hochgeladen und freigegeben werden."},"sidebar-pages":{"id":"sidebar-pages","title":"Seitenleiste","description":"Die Seitenleiste befindet sich auf der linken Seite, sofern eine Veranstaltung ge\xf6ffnet ist. Mit ihr kann man sich durch die ausgew\xe4hlte Veranstaltung bewegen. \xdcber die Seitenleiste sind folgende Seiten erreichbar:"},"structure":{"id":"structure","title":"Grundlegendes","description":"\\\\ Diese Seite ist in Bearbeitung. \\\\"},"submission-card":{"id":"submission-card","title":"Abgabecard","description":"This page will be written soon."},"submissions":{"id":"submissions","title":"Abgaben","description":"Die Seite \u201eAbgaben\u201c ist eine Unterseite einer Veranstaltung. Sie erm\xf6glicht Nutzer\\\\innen das Hochladen von bearbeiteten \xdcbungsaufgaben sowie das Betrachten und Herunterladen der Korrekturen dieser Aufgaben. Dazu legt ein Teammitglied eine Abgabe an und l\xe4dt die anderen ein. Alle beigetretenen Mitglieder k\xf6nnen die Abgabe bearbeiten, z.B. eine Datei hochladen oder ersetzen. Auf die abgegebene Datei k\xf6nnen Tutorinnen nach der Deadline zugreifen und ihre Korrekturen dazu hochladen. Der genaue Ablauf einer Abgabe wird in diesem Tutorial erl\xe4utert. In diesem Artikel hingegen werden die Seite \u201eAbgaben\u201c und Abgaben Betreffendes beschrieben."},"tag":{"id":"tag","title":"Begriff","description":"Auf der Seite \u201eBegriff\u201c finden Nutzer\\\\*innen Synonyme f\xfcr den Begriff, mit dem Begriff verkn\xfcpfte Abschnitte, Begriffe, Medien und Quizzes sowie eine Mindmap (\u201eMaMpf-Map\u201c), die veranschaulicht, mit welchen Begriffen der entsprechende Begriff zusammenh\xe4ngt. Mit der MaMpf-Map k\xf6nnen die Seiten der mit dem Begriff verbunden Begriffe ge\xf6ffnet werden."},"talk":{"id":"talk","title":"Vortrag","description":"Die Seite \u201eVortrag\u201c ist eine Unterseite eines Seminars. Dort befinden sich grundlegende Informationen zum Vortrag (Vortragende, Datum sowie eine Vortragsbeschreibung). Au\xdferdem kann \xfcber diese Seite auf Medien, die zum Vortrag geh\xf6ren, zugegriffen werden. Diese Seite kann von Vortragenden bearbeiten werden, siehe dazu die Seite \u201eVortrag bearbeiten\u201c."},"thank-you":{"id":"thank-you","title":"Thank you!","description":"Congratulations on making it this far!"},"thyme":{"id":"thyme","title":"THymE","description":"THymE steht f\xfcr \u201eThe Hypermedia Experience\u201c. Dabei handelt es sich um den Videoplayer der MaMpf. THymE zeichnet sich dadurch aus, dass sich Betrachter\\\\innen von Videos eine Gliederung und Referenzen anzeigen lassen k\xf6nnen, sofern diese von Editor\\\\innen hinzugef\xfcgt worden sind."},"thyme-editor":{"id":"thyme-editor","title":"THymE-Editor","description":"Mit dem THymE-Editor k\xf6nnen Videos mit einer Gliederung und Referenzen versehen werden. Diese k\xf6nnen Nutzer\\\\*innen dann bei der Videobetrachtung mit THymE, dem mampf-eigenen Hypermediaplayer, ein- und ausblenden."},"tut-ed-ad-tutorials":{"id":"tut-ed-ad-tutorials","title":"Tutorien","description":"This page will be written soon."},"watchlist":{"id":"watchlist","title":"Watchlist","description":"Auf der Seite \u201eWatchlist\u201c k\xf6nnen Nutzer\\\\*innen Medienlisten anlegen, betrachten und bearbeiten."},"worked-examples":{"id":"worked-examples","title":"Worked Examples","description":"Die Seite \u201eWorked Examples\u201c ist eine Unterseite einer Veranstaltung. Sie erm\xf6glicht Nutzer\\\\*innen Zugriff auf Worked Examples zu Themen der Veranstaltung. In einem Worked Example werden inhaltlich zusammengeh\xf6rende Dateien (PDF, Video und externer Link) geb\xfcndelt. Diese k\xf6nnen betrachtet bzw. abgespielt und heruntergeladen sowie kommentiert werden."}}}')}}]);